import React from "react";
import ReactDOM from "react-dom";
import {TodoList} from "./components/todo-list"

const SearchPanel = () => {
  const searchStyle = {
    fontSize: '25px'
  };
  return (
    <input style = {searchStyle} placeholder = "search" />
  );
}
const Hed = () => {
  return (
    <h1>My to do List</h1>
  );
}
const ligbox = <span>Login please</span>;
const login = false;
const App = () => {
  return (
    <div>
      {login ? null : ligbox }
      <Hed />
      <SearchPanel />
      <TodoList />
    </div>
  );
}
const el = App();
ReactDOM.render(el, document.getElementById('root'));
